  <script>
      function getParameterByName(name, url) {
          if (!url) url = window.location.href;
          name = name.replace(/[\[\]]/g, "\\$&");
          var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
              results = regex.exec(url);
          if (!results) return null;
          if (!results[2]) return '';
          return decodeURIComponent(results[2].replace(/\+/g, " "));
      }
      try{
          console.log("document JWT enter");
          document.jwtToken = getParameterByName("jwt");
          console.log("document JWT value:"+document.jwtToken);
      }catch(e){
          console.log(e);
      }
  </script>
